import { Container, Row, Col, Card } from "react-bootstrap";
import "./Home.css";
import SubHome from "./SubHome";
function Home() {
  return (
    <div>
      <Container className="Home" fluid>
        {/* Stack the columns on mobile by making one full-width and the other half-width */}
        <Row>
          <Col xs={12} md={4} style={{ border: "black solid 1px" }}>
            <SubHome title="Users" />
          </Col>
          <Col xs={12} md={4} style={{ border: "black solid 1px" }}>
            <SubHome title="Clincs" />
          </Col>
          <Col xs={12} md={4} style={{ border: "black solid 1px" }}>
            <SubHome title="Users&Clinics" />
          </Col>
        </Row>
      </Container>

      <Container className="Home" style={{ marginTop: "20px" }} fluid>
        {/* Stack the columns on mobile by making one full-width and the other half-width */}
        <Row>
          <Col xs={12} md={6} style={{ border: "black solid 1px" }}>
            <SubHome title="Home" />
          </Col>
          <Col xs={12} md={6} style={{ border: "black solid 1px" }}>
            <SubHome title="Home" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Home;
